import React, {Component} from 'react';
import User from './User'

class Users extends Component{
    state = {
        users :[
            {
                name: 'A'
            },
            {
                name: 'B'
            }
        ]
    }
    render(){
        return(
           <div>
            {
                this.state.map((user)=>{
                    return <User>{user.name}</User>
                })
            }
           </div>
        )
    }
}
export default Users
